import React from "react";
import ReactDOM from "react-dom";
import sum, { sub, div } from "./App";

ReactDOM.render(
  <>
    <ul>
      <li>Sum of two Nub is : {sum(20, 40)}</li>
      <li>Sub of two Nub is : {sub(30, 3)}</li>
      <li>Div of two Nub is : {div(10, 3)}</li>
      <li>Mul of two Nub is : {mul}</li>
    </ul> 
  </>,
  document.getElementById("root")
);
